DROP TABLE IF EXISTS `order_item_cancellations`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `order_item_cancellations` (
  `id` int NOT NULL AUTO_INCREMENT,
  `order_id` int NOT NULL,
  `order_item_id` int NOT NULL,
  `product_id` int NOT NULL,
  `cancelled_quantity` int NOT NULL DEFAULT '1',
  `original_quantity` int NOT NULL,
  `reason` enum('out_of_stock','customer_request','damaged_product','pricing_error','other') NOT NULL DEFAULT 'out_of_stock',
  `cancelled_by_staff_id` int DEFAULT NULL,
  `cancelled_date` timestamp NULL DEFAULT CURRENT_TIMESTAMP,
  `refund_amount` decimal(10,2) NOT NULL DEFAULT '0.00',
  `status` enum('pending','processed','completed','failed') NOT NULL DEFAULT 'pending',
  `customer_notified` tinyint(1) DEFAULT '0',
  `customer_notification_date` timestamp NULL DEFAULT NULL,
  `notes` text,
  `created_date` timestamp NULL DEFAULT CURRENT_TIMESTAMP,
  `updated_date` timestamp NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`),
  KEY `order_item_id` (`order_item_id`),
  KEY `idx_order_cancellations_order_id` (`order_id`),
  KEY `idx_order_cancellations_product_id` (`product_id`),
  KEY `idx_order_cancellations_date` (`cancelled_date`),
  KEY `idx_order_cancellations_status` (`status`),
  CONSTRAINT `order_item_cancellations_ibfk_1` FOREIGN KEY (`order_id`) REFERENCES `orders` (`id`) ON DELETE CASCADE,
  CONSTRAINT `order_item_cancellations_ibfk_2` FOREIGN KEY (`order_item_id`) REFERENCES `order_items` (`id`) ON DELETE CASCADE,
  CONSTRAINT `order_item_cancellations_ibfk_3` FOREIGN KEY (`product_id`) REFERENCES `products` (`id`) ON DELETE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=4 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;
