DROP TABLE IF EXISTS `products`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `products` (
  `id` int NOT NULL AUTO_INCREMENT,
  `name` varchar(100) NOT NULL,
  `description` text,
  `price` decimal(10,2) NOT NULL,
  `stock` int NOT NULL,
  `category_id` int DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  `photo` varchar(255) DEFAULT NULL,
  `warranty` varchar(50) DEFAULT NULL,
  `color_id` int DEFAULT NULL,
  `cpu` varchar(100) DEFAULT NULL,
  `ram` varchar(50) DEFAULT NULL,
  `storage` varchar(100) DEFAULT NULL,
  `warranty_id` int DEFAULT NULL,
  `graphics` varchar(100) DEFAULT NULL,
  `display` varchar(100) DEFAULT NULL,
  `os` varchar(100) DEFAULT NULL,
  `keyboard` varchar(100) DEFAULT NULL,
  `battery` varchar(255) DEFAULT NULL,
  `weight` varchar(50) DEFAULT NULL,
  `back_view` varchar(255) DEFAULT NULL,
  `left_rear_view` varchar(255) DEFAULT NULL,
  `original_price` decimal(10,2) DEFAULT NULL,
  `allow_preorder` tinyint(1) DEFAULT '1',
  `expected_restock_date` date DEFAULT NULL,
  `preorder_limit` int DEFAULT NULL,
  `archived` tinyint(1) NOT NULL DEFAULT '0',
  `deleted` tinyint(1) NOT NULL DEFAULT '0' COMMENT 'Soft delete flag - true if product is deleted but preserved for order history',
  `deleted_at` timestamp NULL DEFAULT NULL COMMENT 'Timestamp when product was deleted',
  `deleted_by` int DEFAULT NULL COMMENT 'User ID who deleted the product',
  `discount_percentage` decimal(5,2) DEFAULT NULL COMMENT 'Applied discount percentage (0-100)',
  PRIMARY KEY (`id`),
